import React from "react" ; 
import ReactDom from "react-dom" ;
import * as obj from "./App" ;
import *as data from "./Array" ;  


ReactDom.render(
  <>
    {obj.App()}

    < obj.greet name = {data.data[0].Name} gf={data.data[0].Gf} />
  </> , 
  document.getElementById("root") 
);
